import Spline from '@splinetool/react-spline';

export default function Keyboard() {
    function onMouseDown(e) {
        if (e.target.name === 'Shape 8') {
          console.log('I have been clicked!');

        }
    }
  return (
    <div>
        <Spline scene="https://prod.spline.design/PmqAUm4IZB-QWHIG/scene.splinecode" onMouseDown={onMouseDown} />
        <Link onClick={onMouseDown} to="/about">
          Go to About
        </Link>
    </div>

  );
}
